import React from "react";
function Table({ tableData }) {
    return (
      <table className="table">
        <thead>
          <tr>
            <th>Id</th>
            <th>course</th>
            <th>Description</th>
            </tr>
        </thead>
        <tbody>
          {tableData.map((data, Id) => {
            return (
              <tr >
                <td>{data.Id}</td>
                <td>{data.course}</td>
                <td>{data.Description}</td>
                </tr>
            );
          })}
        </tbody>
      </table>
    );
  }
  export default Table;
